      SELECT - - col1 - + col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE + CAST ( + 47 AS INTEGER ) - - col2 BETWEEN col1 AND - - 68 * - - col2 * + CAST ( NULL AS INTEGER );
  - name: tab0

outputs:
  - name: q5516.out
    data: |
